import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var ToggleLeft = createReactComponent("ToggleLeft", ["svg", defaultAttributes, [["rect", {
  x: "1",
  y: "5",
  width: "22",
  height: "14",
  rx: "7",
  ry: "7",
  key: "vu0vnq"
}], ["circle", {
  cx: "8",
  cy: "12",
  r: "3",
  key: "1edke8"
}]]]);
export default ToggleLeft;
